import React from 'react';
import './App.css';
import Jobs from "../src/Components/Jobs";

let mockJobs = [];

let obj = [

  { title: "SW1", company: "company 1" },
  { title: "SW1", company: "company 2" },
  { title: "SW1", company: "company 3" },
  { title: "SW1", company: "company 4" },
  { title: "SW1", company: "company 5" },
  { title: "SW1", company: "company 6" },
]
export default class App extends React.Component {

  state = {
    obj: [],
  }

  async componentDidMount() {

    this.handleLoad();
  }

  handleLoad = async () => {

    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "https://jobs.github.com/positions.json"; // site that doesn’t send Access-Control-*
    fetch(proxyurl + url) // https://cors-anywhere.herokuapp.com/https://example.com
      .then(response => response.json())
      .then(contents => {
        mockJobs = Object.keys(contents).map(function (key) {
          return contents[key]
        });
        console.log(mockJobs)

      });

  }

  render() {
    return (
      <div className="App">
        <Jobs jobs={obj} />
      </div>
    )
  }
}
